  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Calhoun National
  Wildlife Refuge & Batchtown National Wildlife Refuge outlines Refuge accomplishments
  from January through April of 1953. The report begins by summarizing the weather
  conditions, water conditions, and food and cover during this period. Wildlife- including
  migratory birds, upland game birds, furbearers, predators, rodents, and mammals-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. The public relations section of the report describes Refuge visitors
  and fishing. N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
